import React from 'react';
import Item from './Item';
import './css/List.css';
import Footer from './footer';


function Budget(props){
    return(
        <div className="principal-list">
            
        <div className="list-item">
            {props.items.map(item =>
           
                <h1>{item.user}</h1>
                     
               
            
        )}
        </div>
        
        </div>
    );
}


export default Budget;
